import classes from "./BookDetail.mocule.css"

const BookDetail =(props)=>{
  return(
    <div>
      <ul>
        <li>Title {props.details.title}</li>
        <li>isbn {props.details.isbn}</li>
        <li>description {props.details.description}</li>
      </ul>

    </div>
  )
}

export default BookDetail
